//wait for the page to render before calling code.
window.addEventListener(
'load', function() {
    addStyles();
    modifyRuinedBlocks();
    modifySpecialBlocks();
    handleMapEdge();
    replacePlayers();
    addListeners();
}, true);

//adds a css style to the page
//css is a string of css code
function addGlobalStyle(css) {
    var head, style;
    head = document.getElementsByTagName('head')[0];
    if (!head) { return; }
    style = document.createElement('style');
    style.type = 'text/css';
    style.innerHTML = css;
    head.appendChild(style);
    
}

//returns the width of any html. html is a string of code that will be constructed.
function getWidth(html)
{
    var spanElement = document.createElement("span");
    spanElement.style.whiteSpace = "nowrap";
    spanElement.innerHTML = html;
    document.body.appendChild(spanElement);
    var width = spanElement.offsetWidth;
    document.body.removeChild(spanElement);

    return width;
}

function getHeight(html)
{
    var spanElement = document.createElement("span");
    spanElement.style.whiteSpace = "nowrap";
    spanElement.innerHTML = html;
    document.body.appendChild(spanElement);
    var height = spanElement.offsetHeight;
    document.body.removeChild(spanElement);

    return height;
}

//returns the x position of any element
function findPosX(obj)
  {
    var curleft = 0;
    if(obj.offsetParent)
        while(1) 
        {
          curleft += obj.offsetLeft;
          if(!obj.offsetParent)
            break;
          obj = obj.offsetParent;
        }
    else if(obj.x)
        curleft += obj.x;
    return curleft;
  }

//returns the y position of any element
function findPosY(obj)
  {
    var curtop = 0;
    if(obj.offsetParent)
        while(1)
        {
          curtop += obj.offsetTop;
          if(!obj.offsetParent)
            break;
          obj = obj.offsetParent;
        }
    else if(obj.y)
        curtop += obj.y;
    return curtop;
  }

//returns the player's gps location in a two element array
function getGPSLoc() {
    var position = new Array();
    
    //find all inputs within the map table
    var allInputs;
    allInputs = document.evaluate(
        "//table[@class='c']//input[@type='hidden']",
        document,
        null,
        XPathResult.ORDERED_NODE_SNAPSHOT_TYPE,
        null);
    
    //when all of the map is visible, there should be 8 nodes
    if (allInputs.snapshotLength == 8) {
        var gpsString = allInputs.snapshotItem(0).value;
        position[0] = parseInt(gpsString.match(/\d+/)) + 1;
        position[1] = parseInt(gpsString.replace(/\d+-/, "")) + 1;
    }
    //when at an edge and not a corner, there would be 5 nodes
    else if (allInputs.snapshotLength == 5) {
        var gpsString = allInputs.snapshotItem(0).value;
        //place the first reading as the gps location
        position[0] = parseInt(gpsString.match(/\d+/));
        position[1] = parseInt(gpsString.replace(/\d+-/, ""));
        
        //if at a left edge
        if (position[0] == 0) {
            if (position[1] < 1) {
                gpsString = allInputs.snapshotItem(1).value;
                position[0] = parseInt(gpsString.match(/\d+/));
                if (position[0] == 2) {
                    position[0] = 1;
                    position[1] = 0;
                }
                else {
                    position[0] = 0;
                    position[1] = 1;
                }
            }
            else if (position[1] == 98) {
                position[0] = 1;
                position[1] = 99;
            }
            else {
                position[1] += 1;
            }
        }
        //if at right edge
        else if (position[0] == 98) {
            //correct the x coordinate
            position[0] = 99;
            //correct the y coordinate
            position[1] += 1;
        }
        //if at a top edge
        else if (position[1] == 0) {
            //correct the x coordinate
            position[0] += 1;
        }
        //if at bottom edge
        else if (position[1] == 98) {
            //correct the x coordinate
            position[0] += 1;
            //correct the y coordinate
            position[1] = 99;
        }
    }
    //when in a corner, there would be only 3 nodes
    else if (allInputs.snapshotLength == 3) {
        var gpsString = allInputs.snapshotItem(0).value;
        //place the first reading as the gps location
        position[0] = parseInt(gpsString.match(/\d+/));
        position[1] = parseInt(gpsString.replace(/\d+-/, ""));
        
        //correct the x coordinate
        if (position[0] == 98)  position[0] = 99;
        else if (position[0] == 1) position[0] = 0;
        
        //correct the y coordinate
        if (position[1] == 98) position[1] = 99;
        else if (position[1] == 1) position[1] = 0;
    }
    //error handling
    else {
        position[0] = -1;
        position[1] = -1;
    }
    
    return position;
}


function addListeners() {
    var clickCount = 0;
    
    //find all the td's
    var allTDs, thisTD;
    allTDs = document.getElementsByTagName('td');
    for (var i = 0; i < allTDs.length; i++) {
        thisTD = allTDs[i];
        if (thisTD.className.match("b ") != null) {
            //add click listener
            //adds listeners to each map cell so that player can click on the cell instead
            //of having to click the button
            thisTD.addEventListener("click", function (event) {
                //if the td contains a form
                var forms = event.currentTarget.getElementsByTagName("form");
                if (forms[0] != null) {
                    //submit the form
                    forms[0].submit();
                    event.stopPropagation();
                    event.preventDefault();
                }
                //the td does not contain a form
                else {
                    clickCount++;
                    if (clickCount == 5) {
                        sptd(event.currentTarget);
                        clickCount = 0;
                    }
                }
            }, true);
            
            //add mouseover listener
            thisTD.addEventListener("mouseover", function (event) {
                highlightBlock(event.currentTarget);
                event.stopPropagation();
                event.preventDefault();
            }, false);
            
            //add mouseout listener
            thisTD.addEventListener("mouseout", function (event) {
                var reallyOut = true;
                var myElements = event.currentTarget.getElementsByTagName("*");
                for (var j = 0; j < myElements.length; j++) {
                    if (myElements[j] == event.relatedTarget) {
                        reallyOut = false;
                    }
                }
                if (reallyOut) {
                    unhighlightBlock(event.currentTarget);
                }
            }, false);
        }
    }
}

