function replacePlayers() {
    //create an array to store the survivors for each map square
    var survivorTDs = new Array();
    for (var k = 0; k < 9; k++) {
        survivorTDs[k] = document.createElement("td");
        survivorTDs[k].style.width = "100%";
        survivorTDs[k].style.height = "100%";
    }
    
    //find all the inputs that are found within the map
    var allInputs;
    allInputs = document.evaluate(
        "//input[@class='mr'] | //input[@class='md'] | //input[@class='ml']",
        document,
        null,
        XPathResult.ORDERED_NODE_SNAPSHOT_TYPE,
        null);
        
    for (var i = 0; i < allInputs.snapshotLength; i++) {
        //get the td that the input belongs to
        var node = allInputs.snapshotItem(i).parentNode
        if (node.tagName != "TD") node = node.parentNode;
        
        var zombieDiv = createZombieDiv();
        
        var survivorDiv = createSurvivorDiv();
        
        //remove br element from td
        myElements = node.getElementsByTagName("br");
        for (var j = 0; j < myElements.length; j++) {
            myElements[j].parentNode.removeChild(myElements[j]);
            j--;
        }
        
        //remove a elements
        myElements = node.getElementsByTagName("a");
        var survivorCount = myElements.length;
        for (j = 0; j < myElements.length; j++) {
            //remove the element
            var survivor = myElements[j];
            myElements[j].parentNode.removeChild(myElements[j]);
            
            //add the survivor to the corresponding survivorTDs index
            survivorTDs[i].appendChild(survivor);
            survivorTDs[i].appendChild(document.createTextNode(" "));
            
            //go backwards 1 to compensate
            j--;
        }
        
        //remove span elements
        var myElements = node.getElementsByTagName("span");
        var zombieCount = 0;
        //go through each span
        for (j = 0; j < myElements.length; j++) {
            //check if the span indicates the number of zombies
            var temp = myElements[j].innerHTML.match(/\d+/);
            if (temp != null) {
                //add to the total number of zombies
                zombieCount += parseInt(temp[0]);
                //remove the span
                myElements[j].parentNode.removeChild(myElements[j]);
            }
            //the span object is indicating there are more survivors
            else {
                survivorCount = 1000;
                //remove the span
                var etcSpan = myElements[j].parentNode.removeChild(myElements[j]);
                survivorTDs[i].appendChild(etcSpan);
                survivorTDs[i].appendChild(document.createTextNode(" "));
            }
            //go backwards 1 to compensate
            j--;
        }
        
        //if there are survivors
        if (survivorCount > 0) {
            //add the survivorDiv to the cell
            node.appendChild(document.createElement("br"));
            
            //change its appearance
            modifySurvivorDiv(survivorDiv, survivorCount, survivorTDs[i]);
            
            node.appendChild(survivorDiv);
        }
        
        //if there are zombies
        if (zombieCount > 0){
            //add a br if there are no survivors
            if (survivorCount == 0) {
                node.appendChild(document.createElement("br"));
            }
            
            //change its appearance
            modifyZombieDiv(zombieDiv, zombieCount);
            
            //add the zombie div to the cell
            node.appendChild(zombieDiv);
        }
    }
    
    function createSurvivorTable() {
        var survivorTable;
        survivorTable = document.createElement("table");
        survivorTable.id = "overlay window";
        survivorTable.style.width = "100px";
        survivorTable.style.height = "100px";
        survivorTable.style.backgroundColor = "rgb(80,100,80)";
        survivorTable.style.position = "absolute";
        survivorTable.style.borderWidth = "2px";
        survivorTable.style.borderStyle = "solid";
        survivorTable.style.borderColor = "rgb(0,0,0)";
        survivorTable.style.textAlign = "center";
        
        var newtr = document.createElement("tr");
        survivorTable.appendChild(newtr);
        
        document.body.appendChild(survivorTable);
        return survivorTable;
    }
    
    function createZombieDiv() {
        var zombieDiv = document.createElement("div");
        zombieDiv.style.backgroundColor = "rgb(0,35,0)";
        zombieDiv.style.color = "rgb(255,255,255)";
        zombieDiv.style.opacity = ".9";
        zombieDiv.style.padding = "0px";
        zombieDiv.style.fontSize = "x-small";
        zombieDiv.style.marginLeft = "auto";
        zombieDiv.style.marginRight = "auto";
        zombieDiv.style.display = "inline-table";
        zombieDiv.style.whiteSpace = "nowrap"
        return zombieDiv;
    }
    
    function modifyZombieDiv(zombieDiv, zombieCount) {
        //add an image to the div
        var zombie = document.createElement("img");
        zombie.src = "data:image/gif,GIF89a%0D%00%17%00%C4%19%00%83%B9%3BW%7C'%1A%25%0C%231%0F%60%88%2BOo%23%3DV%1B%09%0C%04%11%18%08z%AD7%11%18%07%2C%3E%13Fb%1F4J%18%11%19%08%231%10q%A03%3DW%1BEb%1FW%7B'4J%17i%94%2FFc%1F%8C%C6%3F%00%00%00%00%00%00%00%00%00%00%00%00%00%00%00%00%00%00%00%00%00%00%00%00!%F9%04%01%00%00%19%00%2C%00%00%00%00%0D%00%17%00%00%05u%60%26%8AX%13ac**%D7E%A9)%06%5C%06LR%D0%05T%162b%8BJk%A8%3Bd0%81%5D%80%98%A0(0%02h%C6A%B4%1CU%98%C4%B0%06%C3Tm%82%2F%8C%20%8E%11%2F%05%D8%E0%CC%80QZ%15%B2U%C5h%15%0C%AE%F1%04%B5%1E%C0x%24%00%2F*%15%0F%23%801%15(%22%01%83%22%08%12%05F%22%16~%3F%8B%23%16%0B6)%16%01%9C%23%07%02%22!%00%3B";
        zombieDiv.appendChild(zombie);

        //add the number of zombies to the div
        if (zombieCount > 1) {
            zombieDiv.appendChild(document.createTextNode("X " + zombieCount));
        }
        
        //adjust the width of the zombieDiv to the size of the contents
        zombieDiv.style.width = getWidth(zombieDiv.innerHTML) + 10;
        if (zombieDiv.style.width > 40) zombieDiv.style.width = 40;
    }
    
    function createSurvivorDiv() {
        var survivorDiv = document.createElement("div");
        survivorDiv.style.backgroundColor = "rgb(200,200,200)";
        survivorDiv.style.color = "rgb(0,0,0)";
        survivorDiv.style.opacity = ".9";
        survivorDiv.style.padding = "0px";
        survivorDiv.style.width = "50px";
        survivorDiv.style.fontSize = "x-small";
        survivorDiv.style.marginLeft = "auto";
        survivorDiv.style.marginRight = "auto";
        //survivorDiv.style.cssFloat = "left";
        survivorDiv.style.display = "inline-table";
        survivorDiv.style.whiteSpace = "nowrap";
        survivorDiv.style.verticalAlign = "top";
        return survivorDiv;
    }
    
    function modifySurvivorDiv(survivorDiv, survivorCount, listTD) {
        //add an image to the div
        var pic = document.createElement("img");
        pic.src = "data:image/gif,GIF89a%11%00%18%00%C4%1F%00QH%3A%1A%19%15D%3F57'%1641%2B%25%23%1EkK%2CL6!%2C)%23JC7---%10%0F%0C%03%02%02%0C%0B%0A%08%07%05%8Cb9%3B7%2F%14%12%10F1%1CXM%3E%83%5B5eN5oS6qO.%7C%5B%3AWG46%2C%20%23%18%0E%5DJ5%1F%1D%19%3F%3B2%00%00%00!%F9%04%01%00%00%1F%00%2C%00%00%00%00%11%00%18%00%00%05%9C%E0'%8E%DF%209dJ%0E%CF%23%A9%F0%D6%1A0%C3%90Nk%05hj%8B%0C%04%07%03%F0x%3A%A9%CB%A1%F1%09x%12%93%84%F1%D8%2BQ%3C%10%88G0%11L%8D%8B%91%E6%CB%FDN%23%A3F%40%2B(N%05%95%0C%22%B5x%BA%8D%8C%CB%03I%AA%03%26_%1F%0D%077)FRS%850fFs0%1F%8CX%8A8%91h0N%1Eh%05FL0%1D%1E%04%40F%7C*%9F%A4%9B%A4)N%A4N%05%8FN%96%1F%0C%A00%0D%04%1Ea%23%B70%11%0A%05U%1F%9B%B9%8F%7D%1E%01%C4*%0A%9D!%00%3B";
        survivorDiv.appendChild(pic);

        //add mousemove listener
        pic.addEventListener("mousemove", function (event) {
            var survivorTable;
            //find any existing survivorTables
            survivorTable = document.getElementById("overlay window");
            //if the table doesn't already exist
            if (survivorTable == null) {
                //create a new table
                survivorTable = createSurvivorTable();
                //add the listTD element to the table
                survivorTable.appendChild(listTD);
            }

            //update the coordinates of the table
            survivorTable.style.left = event.clientX + 1;
            survivorTable.style.top = event.clientY - 100;

            event.stopPropagation();
            event.preventDefault();
        }, false);

        //add mouseout listener
        pic.addEventListener("mouseout", function (event) {
            var survivorTable;
            //find any existing survivor tables
            survivorTable = document.getElementById("overlay window");
            //if the table exists
            if (survivorTable != null) {
                //remove the table
                survivorTable.parentNode.removeChild(survivorTable);
            }
            event.stopPropagation();
            event.preventDefault();
        }, false);

        //add the number of survivors to the div
        if (survivorCount > 5) {
            survivorDiv.appendChild(document.createTextNode("..."));
        }
        else if (survivorCount > 1) {
            survivorDiv.appendChild(document.createTextNode("X " + survivorCount));
        }
        
        //adjust the width of the survivorDiv to the size of the contents
        survivorDiv.style.width = getWidth(survivorDiv.innerHTML) + 6;
        if (survivorDiv.style.width > 40) survivorDiv.style.width = 40;
    }
}

function modifyRuinedBlocks() {
    //get all inputs with the class mr
    var allInputs;
    allInputs = document.evaluate(
        "//input[@class='mr']",
        document,
        null,
        XPathResult.ORDERED_NODE_SNAPSHOT_TYPE,
        null);
    for (i = 0; i < allInputs.snapshotLength; i++) {
        var node;
        if (allInputs.snapshotItem(i).parentNode.parentNode.tagName == "TD") {
            node = allInputs.snapshotItem(i).parentNode.parentNode;
            if (node.className.match("cxd") != null) {
                allInputs.snapshotItem(i).className = "md";
            }
            //do not match cxr td's because that is an inside ruin
            if (node.className.match(/cxr|cxd/) == null) {
                node.className += " ruin";
            }
        }
        else if (allInputs.snapshotItem(i).parentNode.tagName == "TD") {
            node = allInputs.snapshotItem(i).parentNode;
            if (node.className.match("cxd") != null) {
                allInputs.snapshotItem(i).className = "md";
            }
            //do not match cxr td's because that is an inside ruin
            if (node.className.match(/cxr|cxd/) == null) {
                node.className += " ruin";
            }
        }
    }
}

