function highlightBlock(highlightTD) {
    var currentHighlight = document.getElementById("highlightBlock");
    if (currentHighlight != null && currentHighlight.parentNode != highlightTD) {
        unhighlightBlock(currentHighlight.parentNode);
    }
    
    if (currentHighlight == null || currentHighlight.parentNode != highlightTD) {
        //create a div element
        var cell = document.createElement("div");
        cell.className = "mapHighlight";
        cell.id = "highlightBlock";
        //give the div element the original background-color that was provided
        cell.style.backgroundColor = document.defaultView.getComputedStyle(highlightTD,null).getPropertyValue("background-color");
        while (highlightTD.hasChildNodes()) {
            cell.appendChild(highlightTD.firstChild);
        }
        highlightTD.appendChild(cell);
    }
}

function unhighlightBlock(highlightTD) {
    var cell = highlightTD.firstChild;
    while (cell.hasChildNodes()) {
        highlightTD.appendChild(cell.firstChild);
    }
    highlightTD.removeChild(cell);
}

function handleMapEdge() {
    //get all the map tds
    var allTDs;
    allTDs = document.evaluate(
        "//table[@class='c']//td",
        document,
        null,
        XPathResult.ORDERED_NODE_SNAPSHOT_TYPE,
        null);
        
    var allTableCs;
    allTableCs = document.evaluate(
        "//table[@class='c']",
        document,
        null,
        XPathResult.ORDERED_NODE_SNAPSHOT_TYPE,
        null);

    var mapTable = allTableCs.snapshotItem(0);
    
    var position = getGPSLoc();
    
    if (position[0] == 0) {
        mapTable.style.width = 200;
        mapTable.style.marginLeft = "100px";
        allTDs.snapshotItem(0).colSpan = 2;
    }
    else if (position[0] == 99) {
        mapTable.style.width = 200;
        allTDs.snapshotItem(0).colSpan = 2;
    }
    
    if (position[1] == 0) {
        mapTable.style.height = 200;
        mapTable.style.marginTop = "100px";
        mapTable.style.verticalAlign = "bottom";
    }
    else if (position[1] == 99) {
        mapTable.style.height = 200;
        mapTable.style.marginBottom = "100px";
        mapTable.style.verticalAlign = "top";
    }
}

